  \"Hybrid Lithium-ion Capacitor / Lithium-ion Battery System for Extended Performance
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 56,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T15:24:11.537280\",\n\t\"name\":
  \"hybrid-lithium-ion-capacitor-lithium-ion-battery-system-for-extended-performance-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The work focused on testing the
  Li-ion supercapacitors to confirm their performance and safety.&amp;nbsp; The li-ion
  supercaps were found to be safe under several off-nominal conditions such as overcharge,
  overdischarge into reversal, external short and simulated internal short.&amp;nbsp;
  The li-ion supercaps were found to hold charge for the three month period tested
  and showed insignificant loss in capacity after that hold period.&amp;nbsp; The
  li-ion supercaps were found to have the capability to accept charge quickly from
  a power supply.&amp;nbsp; The testing to provide controlled current from the supercapacitors
  to the battery was not completed due to lack of personnel to carry out the testing.&amp;nbsp;
  With the help of an intern this Fall, that work will be completed.&lt;/p&gt;\",\n\t\"license_title\":
